        console.log(value)
        navigate(`${value}`);
    };

    return(
        <div>
            <Select defaultValue='userMenegment' >
               
                <Option value='userBlocking' onClick={ha}>Blocking</Option>
                <Option value='orderStatusChange'>Change order status</Option>
            </Select>
            <Select defaultValue='getStatistics' >
           
                <Option value='usersData'>Get users data</Option>
                
            </Select>
            <Select defaultValue='Directory management'>
            
                <Option value = 'standart-pizza-list'></Option>
